import React from "react"
import DroneCard from "./DroneCard.js"

const DroneList = (props) => {
    // console.log(props)
    return (
        <nav>
            <h1>{props.name}</h1>
            {props.drones.map(drone => <DroneCard drone={drone} />)}
        </nav>
    )
}

export default DroneList
